function curry(func) {
  const ctx = this;

  return function inner(...args) {
    let needLen = func.length;
    return args.length >= needLen
      ? func.call(ctx, ...args)
      : (...rest) => inner.call(ctx, ...args, ...rest);
  };

  // (...rest) => inner.call(ctx, ...args, ...rest)  Function.prototype.bind 
  // curry(func.bind(ctx,...args), len)
}

