// EventEmitter
class EventEmitter {
  constructor() {
    let map = new Map();
    this.map = map;
  }

  on(name, func) {
    const { map } = this;
    if (name === undefined) {
      throw Error('name ')
    }
    if (typeof func !== 'function') {
      throw Error('func ')
    }
    let list = []
    if (map.has(name)) {
      list = map.get(name)
    }
    //  func 
    if (list.includes(func)) return;
    list.push(func)
    map.set(name, list)
  }

  // on  off 
  once(name, func) {
    let self = this;
    if (name === undefined) {
      throw Error('name ')
    }
    if (typeof func !== 'function') {
      throw Error('func ')
    }
    // ****
    //  func 
    function tempFunc(...args) {
      func(...args);
      // 
      self.off(name, tempFunc)
    }
    this.on(name, tempFunc)
  }

  off(name, func) {
    const { map } = this;
    if (name === undefined) {
      throw Error('name ')
    }
    if (func === undefined) {
      // clear all
      map.delete(name);
    } else {
      let list = map.get(name) || []
      let index = list.findIndex(f => func === f);
      index >= 0 && list.splice(index, 1);
      if (list.length === 0) {
        map.delete(name);
      } else {
        map.set(name, list)
      }
    }
  }

  emit(name, func, ...args) {
    const { map } = this;
    if (name === undefined) {
      throw Error('name ')
    }
    let list = map.get(name) || []
    if (typeof func !== 'function') {
      // 
      list.forEach(f => {
        f(...args)
      });
    } else {
      let f = list.find(f => func === f);
      typeof f === 'function' && f(...args);
    }
  }
}

// LRUCache
class LRUCache {
  constructor(size) {
    this.map = new Map();
    this.size = size;
  }

  set(key, val) {
    const { map, size } = this;
    if (map.has(key)) {
      map.delete(key)
      map.set(key, val)
    } else if (map.size < size) {
      map.set(key, val)
    } else {
      // 
      let firstKey = map.keys().next().value;
      map.delete(firstKey);
      map.set(key, val)
    }
  }

  get(key) {
    const { map } = this;
    let oldVal;
    if (map.has(key)) {
      oldVal = map.get(key)
      map.delete(key)
      map.set(key, oldVal)
    }
    return oldVal;
  }
}


// mock JSON.stringify
function jsonStringify(data, hash = new WeakSet()) {
  let type = typeof data;
  let funUndSym = ['function', 'undefined', 'symbol'];
  if (type !== 'object') {
    // basic
    if (type === 'bigint') {
      throw TypeError('Do not know how to serialize a BigInt')
    }
    if (Number.isNaN(data) || data === Infinity || data === -Infinity) {
      return 'null'
    } else if (funUndSym.includes(type)) {
      return undefined
    } else if (type === 'string') {
      return `"${data}"`;
    }
    return String(data)
  } else if (type === 'object') {
    if (data === null) {
      return 'null'
    }
    // 
    if (hash.has(data)) {
      throw TypeError('Converting circular structure to JSON');
    }
    hash.add(data)
    if (data.toJSON && typeof data.toJSON === 'function') {
      // Date
      return jsonStringify(data.toJSON(), hash);
    } else if (data instanceof Array) {
      let result = [];
      data.forEach((item, index) => {
        if (funUndSym.includes(typeof item)) {
          result[index] = 'null'
        } else {
          result[index] = jsonStringify(item, hash)
        }
      });

      //  toString 
      result = `[${result}]`
      return result.replace(/\'/g, '"')
    } else {
      // 
      let result = [];
      Object.keys(data).forEach((item, index) => {
        //  key  symbol 
        if (typeof item !== 'symbol') {
          if (!funUndSym.some(item1 => item1 === typeof data[item])) {
            result.push(`"${item}":${jsonStringify(data[item], hash)}`)
          }
        }
      })

      return `{${result}}`.replace(/'/g, '"')
    }
  }
}

