// 
function bigNumSum(a, b) {
  a = String(a);
  b = String(b);
  let maxLen = Math.max(a.length, b.length);

  let aPad = a.padStart(maxLen, "0");
  let bPad = b.padStart(maxLen, "0");

  let flag = 0;
  let temp = [];
  for (let i = maxLen - 1; i >= 0; i--) {
    let cur = flag + +aPad[i] + +bPad[i];
    if (cur > 9) {
      flag = 1;
    } else {
      flag = 0;
    }
    temp.unshift(cur);
  }

  if (flag === 1) {
    temp.unshift(1);
  }

  return temp.join("");
}

