function longestCommonSubStr(s1, s2) {
  let dp = [];
  for (let i = 0; i < s1.length + 1; i++) {
    dp[i] = Array(s2.length + 1).fill(0);
  }

  let max = 0;

  for (let i = 1; i < s1.length + 1; i++) {
    for (let j = 1; j < s1.length + 1; j++) {
      if (s1[i - 1] === s2[j - 1]) {
        dp[i][j] = dp[i - 1][j - 1] + 1;
        max = Math.max(max, dp[i][j]);
      } else {
        dp[i][j] = 0;
      }
    }
  }

  return max;
}

