Promise.prototype.finally = function(callback) {
  // Promise
  const P = this.constructor;
  return this.then((value) => {
    return P.resolve(callback()).then(() => {
      return value;
    })
  }, (reason) => {
    return P.resolve(callback()).then(() => {
      throw reason;
    })
  })
}

