//  sqrt(2) 10 
function sqrt(num, smallNum = 10) {
  if (num < 0) return NaN;
  if (num === 0) return 0;
  // const diff = Math.pow(0.1, smallNum);
  let diff = 0;
  if (smallNum >= 1) {
    diff = +`0.${"0".repeat(smallNum - 1)}1`;
  }
  let left = 0;
  let right = num;
  let mid = num >> 1;

  while (Math.abs(+(num - mid * mid).toFixed(smallNum)) > diff) {
    if (num > mid * mid) {
      left = mid;
    } else {
      right = mid;
    }
    mid = left + (right - left) / 2.0;
  }

  return +mid.toFixed(smallNum);
}

