// [{id: 0, pid: -1}, {id: 1, pid: 0}, {id: 2, pid: 0}, {id: 3, pid: 1}]
// treepid-1 {id: 0, children: [{id: 1, children: [{id: 3, children: []}]}, {id: 2, children: []}]}
function array2Tree(list = []) {
  let root = null;
  let map = {};
  // 2 obj
  list.forEach((item) => {
    map[item.id] = item;
  });

  list.forEach((item) => {
    let parent = map[item.pid];
    if (parent) {
      if (!Array.isArray(parent.children)) {
        parent.children = [];
      }
      if (!parent.children.some((item1) => item1.id === item.id)) {
        parent.children.push(item);
      }
    } else {
      root = item;
    }
  });

  return root;
}

// XPath
// DOMxpath
// body>div[0]>main[0]>header[0]>div[0]
function getXPath(dom) {
  return findParent(dom, '')
}

function findParent(dom, path = '') {
  if (dom === document.body) {
    return path === '' ? 'body' : `body>${path}`
  }
  let parentNode = dom.parentNode;
  let tagName = dom.tagName.toLowerCase();
  let index = [...parentNode.children].findIndex(item => item === dom)
  if (path !== '') {
    path = `>${path}`
  }
  path = `${tagName}[${index}]${path}`
  return findParent(parentNode, path)
}

